(function() {
    app.controller('FileDialogCtrl', function($scope, CoResource, Upload, 
    	$rootScope, $mdDialog, $mdToast, $current, $albums) {

    	$scope.uploadingFile = {
    		src: '',
    		obj: null
    	};
    	$scope.data = {};
    	$scope.mode = 'create';
    	$scope.albums = $albums || [];

    	if ($current){
    		$scope.data = angular.copy($current);
            $scope.data.is_home_image = $scope.data.is_home_image == 1 ? true : false;
    		$scope.uploadingFile.src =  $scope.data.file_name;
    		$scope.uploadingFile.obj = {
    			name: $scope.data.caption
    		};
    		$scope.mode = 'edit';
    		$scope.data.tmp_link = $rootScope.mediaUrl + $scope.data.file_name;
    	}

    	$scope.toastPosition = {
	    	bottom: false,
	    	top: true,
	    	left: false,
	    	right: true
	  	};

	 	$scope.close = function (){
	 		$mdDialog.hide();
	 	};

	  	$scope.getToastPosition = function() {
	    	return Object.keys($scope.toastPosition)
	      		.filter(function(pos) { return $scope.toastPosition[pos]; })
	      		.join(' ');
	  	};

    	$scope.chooseFile = function (files){
    		if (files.length > 0){
                var file = files[0];
                $scope.uploadingFile.src = window.URL.createObjectURL(file);
    			$scope.uploadingFile.obj = file;
    			$scope.data.description = file.name;
    			$scope.data.caption = file.name;
    		}
    	};

    	$scope.save = function ($event){
    		$rootScope.loading('show');
    		var current = CoResource.resources.Media.get({ mediaId: $scope.data.id }, function (){
    			current.description = $scope.data.description;
    			current.caption = $scope.data.caption;
                current.album_id = $scope.data.album_id;
                current.seq_no = $scope.data.seq_no;
    			current.is_home_image = $scope.data.is_home_image;
    			current.$update({ mediaId: $scope.data.id }, function (){
    				$rootScope.$emit('dataMediaUploaded');
    				$rootScope.loading('hide');
					$mdToast.show(
				      	$mdToast.simple()
				        	.content('Media updated')
				        	.position($scope.getToastPosition())
				        	.hideDelay(3000)
				    );
    			}, function (){
    				$rootScope.loading('hide');
    				alert('There was an error while trying to update media meta data');
    			});
    		});
    	};

    	$scope.startUpload = function() {
            if (!$scope.uploadingFile.obj){
            	return;
            }
            $rootScope.loading('show');

            $scope.upload = Upload.upload({
                url: '/api/v1/media', // upload.php script, node.js route, or servlet url
                method: 'POST',
                //headers: {'Authorization': 'xxx'}, // only for html5
                //withCredentials: true,
                method: 'POST',
                headers: {
                }, // only for html5
                data: {
                    "caption": $scope.data.caption,
                    "description": $scope.data.description,
                    "imagable_type": "Media",
                    "imagable_id": 0,
                    "album_id": $scope.data.album_id,
                    "seq_no": $scope.data.seq_no,
                    "is_home_image": $scope.data.is_home_image,
                    "type": "document"
                },
                file: $scope.uploadingFile.obj, // single file or a list of files. list is only for html5
                //fileName: 'doc.jpg' or ['1.jpg', '2.jpg', ...] // to modify the name of the file(s)
                //fileFormDataName: myFile, // file formData name ('Content-Disposition'), server side request form name
                // could be a list of names for multiple files (html5). Default is 'file'
                //formDataAppender: function(formData, key, val){}  // customize how data is added to the formData. 
                // See #40#issuecomment-28612000 for sample code
            }).progress(function(evt) {
                // console.log('progress: ' + parseInt(100.0 * evt.loaded / evt.total) + '% file :' + evt.config.file.name);
                evt.config.file.progress = parseInt(100.0 * evt.loaded / evt.total);
            }).success(function(data, status, headers, config) {
            	$rootScope.loading('hide');
            	$mdDialog.hide();

				$mdToast.show(
			      	$mdToast.simple()
			        	.content('File uploaded')
			        	.position($scope.getToastPosition())
			        	.hideDelay(3000)
			    );
			    $rootScope.$emit('dataMediaUploaded');
                
            }).error(function(data, status, headers, config) {
            	alert('There was an error while trying to upload file.');
            	console.log(data, status);
            	$rootScope.loading('hide');
            });
        };


        $scope.remove = function (media){
            // Appending dialog to document.body to cover sidenav in docs app
            if (media.imagable_type === 'Directory'){
                alert('Sorry, you cannot delete Directory\'s media gallery from here. Please, delete it at directory page');
                return;
            }
            var confirm = $mdDialog.confirm()
                .parent(angular.element(document.body))
                .title('Delete this gallery?')
                .content('Are sure to do so? Once you deleted, you won\'t be able to retrieve it back!')
                .ariaLabel('Delete Media')
                .ok('Yes')
                .cancel('No')
                .targetEvent(null);
            $mdDialog.show(confirm).then(function() {
                $rootScope.loading('show');
                CoResource.resources.Media.delete({
                    mediaId: media.id
                }, function (s){
                    $rootScope.loading('hide');
                    $rootScope.$emit('dataMediaUploaded');
                    $mdToast.show(
                        $mdToast.simple()
                            .content('Gallery removed')
                            .position($scope.getToastPosition())
                            .hideDelay(3000)
                    );
                }, function (e){
                    $rootScope.loading('hide');
                    alert('Sorry, this media cannot be deleted due to some reason, please contact administrator for more information');
                });
                
            }, function() {
            });
        };
        
    });
}());
(function (){
	app.controller('ShopListingCtrl', function($scope, CoResource, 
		$routeParams, $rootScope, $mdDialog, $mdToast, $location, $timeout){
		$scope.directories = [];

		$scope.search = {
			query: $location.search().search || ''
		};

		$scope.getMapUrl = function(directory){
			var url = 'https://maps.googleapis.com/maps/api/staticmap?key=AIzaSyCrP9rxOqS4yAxtd-3cT9kJTYnO5fpnJoY&center=' + (directory.latitude || '13.3671') + ',' + (directory.longitude || '103.8448') +
				'&zoom=14&size=200x150&maptype=roadmap&markers=color:blue%7Clabel:E%7C' + (directory.latitude || '13.3671') + ',' + (directory.longitude || '103.8448');
			return url;
		};

		$scope.view = function(directory){
			$location.path('shops/' + directory._id);
		};	

		$scope.createShop = function(directory){
			$location.path('shops/create');
		};	


	    // Manific
	    function renderMagnific(){
	        $('.mini-gallery-list').magnificPopup({
	            type: 'image',
	            removalDelay: 300,
	            mainClass: 'mfp-with-zoom',
	            delegate: 'li.gallery-item', // the selector for gallery item,
	            titleSrc: 'title',
	            tLoading: '',
	            gallery: {
	                enabled: true
	            },
	            callbacks: {
	                imageLoadComplete: function() {
	                    var self = this;
	                    setTimeout(function() {
	                        self.wrap.addClass('mfp-image-loaded');
	                    }, 16);
	                },
	                open: function() {
	                    // $('#header > nav').css('padding-right', getScrollBarWidth() + "px");
	                },
	                close: function() {
	                    this.wrap.removeClass('mfp-image-loaded');
	                    // $('#header > nav').css('padding-right', "0px");
	                },
	            }
	        });
	    }

		
	    // Pagination
	    $scope.pagination = {
	    	limit: 15,
	    	offset: $location.search().offset || 1,
	    	current: 1
	    };

	    $scope.changePage = function(current){
	    	$scope.pagination.current = current;
	    };

	    $scope.preparePagination = function (){	    	
		    var amount = $scope.pagination.total_record > $scope.pagination.limit ? Math.round($scope.pagination.total_record / $scope.pagination.limit) : 0;

		    $scope.pagination.total = _.map(new Array(amount), function (value, key){
		    	return key + 1;
		    });
	    };

	    $scope.changeOffset = function (offset){
	    	$scope.pagination.offset = offset;
	    };

	    function loadData(callback, offset, limit){
	    	offset = offset || $scope.pagination.offset;
	    	limit = limit || 10;
	    	console.log('load data');
			$scope.directories = CoResource.resources.Directory.list({
				'offset': (offset - 1) * limit || 0,
				'limit': limit || 10,
		    	'ignore-offset': 0,
		    	'search': $scope.search.query || '',
		    	'sort': $scope.sort || '',
		    	'scope': 'foods,origins,categories,features,menu,drinks,payment_methods,parkings',
		    }, function(s) {
		    	$scope.directories = s.result;
		    	$scope.pagination.total_record = s.options.total;
		    	$scope.preparePagination();
		    	setTimeout(function (){
		    		renderMagnific();
		    	}, 2000);

		    	if (callback){
		    		callback();
		    	}
		    });
	    }

	    loadData();

	    $scope.onPageChanged = function (){
	    	$location.search('offset', $scope.pagination.offset);
	  //   	$rootScope.loading('show');
			// loadData(function (){
			// 	$rootScope.loading('hide');
			// }, $scope.pagination.offset, 10);
	    };

		$scope.sort = '';
	    $scope.changeSort = function (){
	    	if ($scope.sort == ''){
	    		$scope.sort = 'desc';
	    	}
	    	else if ($scope.sort == 'desc'){
	    		$scope.sort = 'asc';
	    	}
	    	else{
	    		$scope.sort = '';
	    	}

	    	$rootScope.loading('show');
	    	loadData(function (){
		    	$rootScope.loading('hide');
	    	});

	    };

	    $scope.$watch('search.query', function (v, old){	
			if (v == old){
				return;
			}    	
	    	// $rootScope.loading('show');

	    	// loadData(function (){
		    // 	$rootScope.loading('hide');
	    	// });
	    	$location.search('search', v);
	    });

	    var timer = null;
	    function startCalling(){
	    	if (timer){
	    		$timeout.cancel(timer);
	    	}
	    	timer = $timeout(function (){

		    	$rootScope.loading('show');

		    	loadData(function (){
			    	$rootScope.loading('hide');
		    	});
	    	}, 700);

	    }

	    /* EVENT WATCHERS */

		var watchers = {};
		watchers['search'] = $scope.$watch(function() {
			return $location.search().search;
		}, function(v, old) {

			if (v == old){
				return;
			}

			$scope.search.query = v;
			startCalling();
		});

		watchers['offset'] = $scope.$watch(function() {
			return $location.search().offset;
		}, function(v, old) {

			if (v == old){
				return;
			}

			$scope.pagination.offset = v;
			startCalling();
		});

		$scope.$on('$destroy', function (){
			for(var key in watchers){
				watchers[key]();
			}
			$location.search('offset', null);
			$location.search('search', null);
		});

	});


}());
